head.script:
var toTag = [
    {
        elementId: 'snapshot-submit-input',
        classes: 'plausible-event-name=Tester+Click'
    }
]

document.addEventListener('DOMContentLoaded', function (_e) {
    toTag.forEach(function (tagObject) {
        var element = document.getElementById(tagObject.elementId)
        tagObject.classes.split(' ').forEach(function (className) {
            if (element) { element.classList.add(className) }
        })
    })
})

body.script:
async function getStargazers() {
  const res = await fetch(
    `https://api.github.com/repos/browserless/browserless`
  );
  const json = await res.json();

  const starCount = Intl.NumberFormat("en", {
    notation: "compact",
    maximumSignificantDigits: 2,
  }).format(json.stargazers_count);

  const $stargazers = document.getElementById('stargazers');
  $stargazers.classList.remove("stargazers-loading");
  $stargazers.innerText = starCount;
}
getStargazers();

const forwardReferral = () => {
  const HOSTNAMES = [
    "browserless.webflow.io",
    "www.browserless.io",
    "browserless.io",
    "docs.browserless.io",
    "localhost",
    "browserless.localhost",
    "account.browserless.io",
  ];

  const referral = new URL(window.location).searchParams.get("fpr");
  if (!referral) {
    return;
  }

  [...document.querySelectorAll("a")].forEach((anchor) => {
    anchor.addEventListener("click", (event) => {
      event.preventDefault();

      const url = new URL(anchor.href);
      if (!HOSTNAMES.includes(url.hostname)) {
        return window.location.assign(anchor.href);
      }

      url.searchParams.set("fpr", referral);
      window.location.assign(url.href);
    });
  });
};

forwardReferral();
